import { createStore } from "vuex";


export default createStore({
    state: {
        message: "Hello Vuex!",
        users: {
            id: 1,
            name: "Tran Van Thinh",
            age: 20
        },
        products: [
            {id: 1, name: "Product 1", qty: 0},
            {id: 1, name: "Product 1", qty: 10},
            {id: 1, name: "Product 1", qty: 30},
            {id: 1, name: "Product 1", qty: 60},
            {id: 1, name: "Product 1", qty: 100}
        ]
    }
})
